    changeCoDiv("71");
  }
  TZLOG(logParam, (data) => {});
  setTimeout(funcDate, 3000);
}

funcDate:
function funcDate() {
  const fulldate = [year, month, date].join("");
  onClickDay(fulldate);
  setTimeout(funcTime, 3000);
}
